      //   body: JSON.stringify({ email, password }),
      // });
      // let data = await response.json();
      return data;
    } catch (error) {
      console.log(error);
    }
  }

  async signUp(user: User) {
    try {
      console.log("sign out");
    } catch (error) {
      console.log(error);
    }
  }
}

const authService = new AuthService();
export default authService;
